import React from 'react';
// import Card from './Card';

const App = () => {
  const numbers = [1, 4, 6, 8, 45, 89];
  const lis = numbers.map((number) => <li> {number}</li>);
  const getNumber = () => {
    const value = value;
    numbers.map((n) => {
      if (n >= value) {
        return <li>{number}</li>;
      }
    });
  };
  return (
    <>
      <ul>{lis}</ul>
      <form>
        <input type='text' value='' onChange={getNumber}></input>
      </form>
    </>
  );
};
export default App;
